import Login from "./Login";
import Signup from "./Signup";
import React from "react";
import './App.css';
import Navbar from '../components/Navbar/Navbar';
import { BrowserRouter as Router, Route, Routes} from "react-router-dom";

import Dashboard from "./Dashboard";
import { AuthRoute, ProtectedRoute } from "../utils/route";

export default function App() {
  const lang = useState(JSON.parse(localStorage.getItem('isBool')));

    return ( 
      <Router>
      <Navbar language={lang} />
      <Routes>
        <Route path='/' element={<Index language={lang}/>} />
        <Route path='/index' element={<Index language={lang}/>} />
        <Route path='/venue' element={<Venue language={lang}/>} />
        <Route path='/weddingday' element={<WeddingDay language={lang}/>} />
        <Route path='/discover' element={<Discover language={lang}/>} />
        <Route path='/music' element={<Music language={lang}/>} />
        <Route path='/gifts' element={<Gifts language={lang}/>} />
        <Route path='/login' element={<Login />} />
      </Routes>
    </Router>
          //    <Navbar/>

          // <AuthRoute path="/" component={Login} />
          // <AuthRoute path="/login" component={Login} />
          // <AuthRoute path="/signup" component={Signup} />
          // <ProtectedRoute path="/dashboard" element={<Dashboard language={"lang"}/>}/>

    );
}
